import React from 'react'
import './videoitem.css'

/* const handleVideoSelect = video => {
    props.onVideoSelect(video)
    console.log(`selected Video=>  ${video.snippet.title}`)
} */

const VideoItem =  ({ video, onVideoSelect }) => {
    return (

        <div onClick={() => onVideoSelect(video)} class="item video-item">
            <img class="ui image" src={video.snippet.thumbnails.medium.url} alt={video.snippet.title} />
            <div class="content">
                <div class="header">{video.snippet.title}</div>
            </div>
        </div>


    )
}

export default VideoItem
